text:
@CainAislinn @anet2111 I was in the hospital (Jan) for 10 days with #COVID19 pneumonia. Total cost, just over $88,000 plus another $3,500 for a follow up CT scan a month later.

Thanks to my excellent insurance, my out of pocket was $1,000 and all my follow-up scripts were free.

Get the #CovidVaccine.
